INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "キャル", 7, 1, 106001, 7001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "コッコロ", 7, 1, 105901, 7002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "ペコリーヌ", 7, 1, 105801, 7003, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "ペコリーヌ", 10, 1, 105801, 10001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "キャル", 10, 1, 106001, 10002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "コッコロ", 10, 1, 105901, 10003, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "シェフィ", 10, 1, 106401, 10004, 2, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-416.5, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 12, 1, 105801, 12001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "キャル", 13, 1, 106001, 13001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 13, 1, 105901, 13002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 13, 1, 106401, 13003, 2, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "ペコリーヌ", 13, 1, 105801, 13004, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "コッコロ", 14, 1, 105901, 14001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "シェフィ", 14, 1, 106401, 14002, 2, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "ペコリーヌ", 14, 1, 105801, 14003, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "キャル", 14, 1, 106001, 14004, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-470.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "コッコロ", 15, 1, 105901, 15001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "シェフィ", 16, 1, 106401, 16001, 2, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "ペコリーヌ", 16, 1, 105801, 16002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "キャル", 16, 1, 106001, 16003, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "コッコロ", 16, 1, 105901, 16004, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "コッコロ", 17, 1, 105901, 17002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "キャル", 25, 1, 106001, 17004, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "コッコロ", 25, 1, 105901, 17005, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "シェフィ", 25, 1, 106401, 17006, 2, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "ペコリーヌ", 25, 1, 105801, 17007, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "カリン", 18, 1, 190801, 18001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "カリン", 18, 2, 190801, 18002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-470.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "カリン", 19, 3, 190801, 19001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-470.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "カリン", 19, 4, 190801, 19002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-470.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "カリン", 20, 5, 190801, 20001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-470.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "カリン", 20, 6, 190801, 20002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "キャル", 21, 1, 106001, 21001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "コッコロ", 21, 1, 105901, 21002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "シェフィ", 21, 1, 106401, 21003, 2, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "ペコリーヌ", 21, 1, 105801, 21004, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-430.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "カリン", 22, 1, 190801, 22001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-430.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "カリン", 22, 2, 190801, 22002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-430.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "カリン", 23, 3, 190801, 23001, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-430.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "カリン", 23, 4, 190801, 23002, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 24, 1, 109001, 24001, 1, 2, 4.08, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 24, 2, 109001, 24002, 1, 2, 5.0, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 24, 3, 109001, 24003, 1, 2, 10.11, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 24, 4, 109001, 24004, 1, 2, 4.0, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 24, 5, 109001, 24005, 1, 2, 6.0, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 24, 6, 109002, 24006, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 24, 7, 109002, 24007, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 24, 8, 109002, 24008, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 24, 9, 109002, 24009, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 24, 10, 109002, 24010, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "シズル（バレンタイン）", 24, 1, 109101, 24011, 1, 2, 2.12, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "シズル（バレンタイン）", 24, 2, 109101, 24012, 5, 2, 4.19, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "シズル（バレンタイン）", 24, 3, 109101, 24013, 2, 4, 2.3, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "シズル（バレンタイン）", 24, 4, 109102, 24014, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "シズル（バレンタイン）", 24, 5, 109101, 24015, 5, 2, 5.23, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "シズル（バレンタイン）", 24, 6, 109102, 24016, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-385.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "シズル（バレンタイン）", 24, 7, 109101, 24017, 1, 2, 5.01, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "シズル（バレンタイン）", 24, 8, 109102, 24018, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "シズル（バレンタイン）", 24, 9, 109102, 24019, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2019/01/31 12:00:00", 0, "2030/12/17 14:59:59", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "シズル（バレンタイン）", 24, 10, 109102, 24020, 1, 1, 0.0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 2104010, "2030/12/17 14:59:59", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "シェフィ", 26, 1, 106401, 26001, 2, 1, 0.0, 0.0);
