INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (-363.0, 0, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "キャル", 43, 1, 106001, 43003, 1, 1, 0.0, 0.0);
